import React, { useRef, useEffect } from "react";
import { useSelector } from "react-redux";
import CardFeature from "../component/CardFeature";
import HomeCard from "../component/HomeCard";
import { GrPrevious, GrNext } from "react-icons/gr";
import FilterProduct from "../component/FilterProduct";
import AllProduct from "../component/AllProduct";
import logo from "../assest/logo.png";
import "./home.css"; 
import Rreact, {  } from 'react';


const Home = () => {
  const productData = useSelector((state) => state.product.productList);
  const homeProductCartList = productData.slice(1, 5);
  const homeProductCartListVegetables = productData.filter((el) => el.category === "vegetable");
  const loadingArray = new Array(4).fill(null);
  const loadingArrayFeature = new Array(10).fill(null);

  const slideProductRef = useRef();

  const nextProduct = () => {
    slideProductRef.current.scrollLeft += 200;
  };

  const preveProduct = () => {
    slideProductRef.current.scrollLeft -= 200;
  };

  useEffect(() => {
    // Create elements using JavaScript
    const felizDiv = document.createElement('div');
    felizDiv.classList.add('feliz');
    felizDiv.textContent = 'AGRIDUCT';

    const anoNovoDiv = document.createElement('div');
    anoNovoDiv.classList.add('ano_novo');

    const span1 = document.createElement('span');
    span1.textContent = 'BUY FROM';

    const span2 = document.createElement('span');
    span2.classList.add('seis');
    span2.textContent = 'DEALERS';

    const span3 = document.createElement('span');
    span3.classList.add('sete');
    span3.textContent = 'FARMERS';

    const balaoDiv = document.createElement('div');
    balaoDiv.classList.add('balao');

    const fogosDiv = document.createElement('div');
    fogosDiv.classList.add('fogos');

    for (let i = 1; i <= 4; i++) {
      const fDiv = document.createElement('div');
      fDiv.classList.add(`f${i}`);
      for (let j = 1; j <= 3; j++) {
        const span = document.createElement('span');
        const iTag = document.createElement('i');
        span.appendChild(iTag);
        fDiv.appendChild(span);
      }
      fogosDiv.appendChild(fDiv);
    }

    // Append elements to the body or any desired container
    document.body.appendChild(felizDiv);
    anoNovoDiv.appendChild(span1);
    anoNovoDiv.appendChild(span2);
    anoNovoDiv.appendChild(span3);
    anoNovoDiv.appendChild(balaoDiv);
    document.body.appendChild(anoNovoDiv);
    document.body.appendChild(fogosDiv);

    // Clean up logic (optional)
    return () => {
      document.body.removeChild(felizDiv);
      document.body.removeChild(anoNovoDiv);
      document.body.removeChild(fogosDiv);
    };
  }, []);


 


  



  return (
    <div className=" home p-2 md:p-4 ">

      <div className="md:flex gap-4 py-2">
        <div className="md:w-3/4 p-5">
          <div className="flex gap-3 bg-white w-36 px-2 items-center rounded-full">
            <p className="text-sm font-bold text-yellow-400 ">Bike Delivery</p>
            <img
              src="https://cdn-icons-png.flaticon.com/512/2972/2972185.png"
              className="h-7"
            />
          </div>
          <h2 className="text-4xl md:text-7xl font-bold py-5 px-6 text-white">
            The Fasted Delivery From Farmers{" "}
            <span className="text-yellow-500 text-">To Your Home</span>
          </h2>
          
          {/* <p className="py-3 text-base ">
            Lorem Ipsum is simply dummy text of the printing and typesetting
            industry. Lorem Ipsum has been the industry's standard dummy text
            ever since the 1500s, when an unknown printer took a galley of type
            and scrambled it to make a type specimen book. It has survived not
            only five centuries
          </p> */}
          <button className="font-bold bg-yellow-500 text-white px-4 py-2 rounded-md">
            Order Now
          </button>
        
          
        
          
        </div>

        <div className="md:w-3/4 flex flex-wrap gap-8 p-4 justify-center ">
          {homeProductCartList[0]
            ? homeProductCartList.map((el) => {
                return (
                  <HomeCard
                    key={el._id}
                    id={el._id}
                    image={el.image}
                    name={el.name}
                    price={el.price}
                    quantity={el.quantity}
                    category={el.category}
                  />
                );
              })
            : loadingArray.map((el, index) => {
                return <HomeCard key={index+"loading"} loading={"Loading..."} />;
              })}
        </div>
      </div>

      <div className="">
        <div className="flex w-full items-center p-5">
          <h2 className="font-bold text-2xl text-white mb-3 bg-yellow-500 px-5 rounded-full">
            Fresh Vegetables
          </h2>
          <div className="ml-auto flex gap-4">
            <button
              onClick={preveProduct}
              className="bg-yellow-300 hover:bg-yellow-400 text-lg  p-2 rounded-md"
            >
              <GrPrevious />
            </button>
            <button
              onClick={nextProduct}
              className="bg-yellow-300 hover:bg-yellow-400 text-lg p-2 rounded-md
              "
            >
              <GrNext />
            </button>
          </div>
        </div>
        <div
          className="flex gap-8 overflow-scroll scrollbar-none scroll-smooth transition-all p-5"
          ref={slideProductRef}
        >
          {homeProductCartListVegetables[0]
            ? homeProductCartListVegetables.map((el) => {
                return (
                  <CardFeature
                    key={el._id+"vegetable"}
                    id={el._id}
                    name={el.name}
                    category={el.category}
                    quantity={el.quantity}
                    price={el.price}
                    image={el.image}
                  />
                );
              })
            : loadingArrayFeature.map((el,index) => (
                <CardFeature loading="Loading..." key={index+"cartLoading"} />
              ))}
        </div>
      </div>
      <div>
      <AllProduct heading={"Your Product"}/>
      </div>
      
    </div>
  );
};

export default Home;
